Let's create a new module, HsBlog.Directory, which will be responsible for handling directories and multiple files. From this module we will export the convertDirectory and buildIndex functions we've defined before. -- | Process multiple files and convert directories module HsBlog.Directory ( convertDirectory , buildIndex ) where In this module we are going to use the directory and filepath libraries to manipulate directories, files and filepaths. We'll use the new abstractions we've learned Traversable and Monad and the concepts and types we've learned about: Either, IO and exceptions. For all of that, we need quite a few imports: import qualified HsBlog.Markup as Markup
import qualified HsBlog.Html as Html
import HsBlog.Convert (convert, convertStructure) import Data.List (partition)
import Data.Traversable (for)
import Control.Monad (void, when) import System.IO (hPutStrLn, stderr)
import Control.Exception (catch, displayException, SomeException(..))
import System.Exit (exitFailure)
import System.FilePath ( takeExtension , takeBaseName , (<.>) , (</>) , takeFileName )
import System.Directory ( createDirectory , removeDirectoryRecursive , listDirectory , doesDirectoryExist , copyFile ) If you are unsure what a specific function we're using does, look it up at good, read the type signature and the documentation, and play around with it in ghci.
